func NewRPCClient(address string) *RpcClient {
	var err error
	rpcClient := &RpcClient{}
	rpcClient.Client, err = rpc.Dial(address)
	if err != nil {
		panic(err)
	}
	rpcClient.EthClient = ethclient.NewClient(rpcClient.Client)
	if err != nil {
		panic(err)
	}
	return rpcClient
}

